import React, { Component } from 'react';

//Components
import LunchroomComponent from './LunchroomComponent';

//CSS
import "./Lunchrooms.css";

import biologia from '../../images/lunchrooms/biologia.png';

class Lunchrooms extends Component {
  state = {
    lunchrooms:[
      {name:"Biologia", ed:"Edificio: 421"},
      {name:"Café Campus", ed:"Edificio: 212 parte posterior"}
    ]
  }
  render() {
    return (
      <div className="Lunchrooms">
        <div className="Container">
          <div className="row">
            { this.state.lunchrooms.map(lunchroom => <LunchroomComponent key={lunchroom.name}/>) }
            <LunchroomComponent/>
            <LunchroomComponent/>
            <LunchroomComponent/>
            <LunchroomComponent/>
            <LunchroomComponent/>
            <LunchroomComponent/>
            <LunchroomComponent/>
          </div>
        </div>
      </div>
    );
  }
}

export default Lunchrooms;
